description:
Danica Dillon has been hired to replace Aaron due to his poor performance, leading to the lack of revenue being generated. When Aaron gets the bad news, he finds the silver lining and tells Danica that he's always had a crush on her, and since he's not an employee anymore, he can't get canned if he bangs the hot brunette on the desk! Horny Danica is willing to take the risk, so she spreads her legs wide open and gets drilled in her new office!

